import React, { Component } from "react";

class Social extends Component {
  render() {
    return (
      <div class="social">
        <a
          href="https://Linkedin.com/in/caden-westmoreland-a6904a178"
          target="_blank"
          rel="noopener noreferrer"
        >
          <i class="fab fa-linkedin-in"></i>
        </a>
      </div>
    );
  }
}

export default Social;
